import React from 'react';

const Contributions = () => {
  return (
    <section id="contributions">
      <h2>Contributions to Society</h2>
      <p>Volunteering: I actively participate in local community service projects, dedicating my time to organizations that support underprivileged families. My efforts include organizing food drives and tutoring students, helping them develop essential skills for their education.</p>
    </section>
  );
};

export default Contributions;
